import React from "react";
import { Route, Redirect } from "react-router";



function ProtectedRoute({ loggedIn, children }) {

  return (
    <Route>{() => (loggedIn ? <>{children}</> : <Redirect to="/" />)}</Route>
  );
}

export default ProtectedRoute;
